import styled, { keyframes } from 'styled-components';

export const Button = styled.button`
    border-radius: 50%;
    border: none;
    background: #f3969a;
    width: 40px;
    height: 40px;
    display: flex;
    align-items: center;
    justify-content: center;
    margin-right: 10px;

    & svg {
      fill: #fff;
      width: 22px;
      height: 22px;
    }
`;
